import "./App.css";
import Grid from "./components/Grid";
import Pagination from "./components/Pagination";
import ConvertPage from "./components/ConvertPage";
import Index from "./pages/React7UseBootstrap";

function App() {
  return (
    <div className="App">
        <Grid />
        <Pagination />
        <ConvertPage />
        <Index />
    </div>
  );
}

export default App;
